/* Vomnibar */

#vomnibar {
    background: #333;
    border-radius: 0;
    box-shadow: none;
}

#vomnibar .vomnibarSearchArea {
    background-color: #222;
    border: none;
    border-color: #fff;
    border-radius: 0;
    border-style: solid;
    border-width: 0 0 0 4px;
}

#vomnibar .vomnibarSearchArea > input {
    background-color: #222;
    border: none;
box-shadow: none;
    color: #fff;
}

#vomnibar ul {
    background-color: #333;
    border-radius: 0;
 margin-top: -10px;
}

#vomnibar li {
    background-color: transparent;
    border-color: #F8F;
    border-style: solid;
    border-width: 0;
    margin-top: 10px;
    transition: background-color 0.1s ease;
}

#vomnibar li em,
#vomnibar li .vomnibarTitle {
    color: #fff;
}

#vomnibar li em .vomnibarMatch,
#vomnibar li .vomnibarTitle .vomnibarMatch,
#vomnibar li .vomnibarMatch {
    color: #fff;
}

#vomnibar li .vomnibarUrl {
    color: #ccc;
}

#vomnibar li.vomnibarSelected {
    background-color: #444;
}
